import React, { lazy } from "react";
import { Modal, Button } from 'react-bootstrap'

class EditPopUP extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data:[]
    };
  }


  render() {
    const handleClose = () => {
      this.props.onHide();
    };
    return (
      <div>
        <Modal
          backdrop="static"
          show={this.props.show}
          onHide={handleClose}
          className="PopUp"
        >
          <Modal.Header closeButton>
          </Modal.Header>
          <Modal.Body>
            <div className="form-group">
              <label>Name</label>
                <input 
                  type='text'
                  value={this.props.selectedFiles[0].data['name']}
                  className="form-control"
                />
            </div>
            <div className="form-group">
              <label>Email</label>
                <input 
                  type='email'
                  value=""
                  className="form-control"
                />
            </div>
            <button className="btn btn-primary mt-3">Update</button>
          </Modal.Body>
          <Modal.Footer />
        </Modal>
      </div>
    );
  }
}

export default EditPopUP;
